[50098] = {icon="Interface\\Icons\\INV_Stone_16",description="1. Summon Uuna and wait for her to say one of the following lines:\n'|cffffffffMama? Mama! Why is it so dark? It's scary here...|r'\n'|cffffffffCan anybody hear me?|r'\n'|cffffffffC-c-cold...|r'\n",title="Steps 1-4: A New Friend"},
[50099] = {description="2. |cffffffff/whistle|r at Uuna.\n",title="2. /whistle at Uuna"},
[50100] = {description="3. When she asks you questions, |cffffffff/roar|r at her.\n",title="3. /roar at Uuna"},
[50101] = {description="4. Resummon Uuna and |cffffffff/cry|r at her.  She will tell you that she wishes she could see you better, but it's too dark where she is.",title="4. /cry at Uuna"},
[50102] = {coords={{54,44.7,111}},description="Take Uuna to A'dal in Shattrath City.  The light of the Naaru is too bright, and she will run away.",title="Step 5: Bright Lights",icon="Interface\\Icons\\INV_Stone_16"},
[50103] = {coords={{18.9,41.6,63}},description="Take Uuna to the moonlight by Ashenvale's Lake Falathim.",title="Step 6: Wanna be Friends?",icon="Interface\\Icons\\INV_Stone_16"},
[50104] = {icon="Interface\\Icons\\inv_misc_bag_07_red",description="Most classes will need 2 |cffffffffGoblin Glider Kits|r to reach Nuu, who is in a house on a floating island in southwest Mac'Aree.\n\nStart near the entrance to Seat of the Triumvirate and glide to the small rock, and then use your second glider to coast to the island further to the south.",title="Step 7: Finding Nuu",coords={{32.6,74.9,882},{25.1,59.8,882}}},
[50105] = {coords={{56.4,56.6,106}},description="Take Uuna to Blood Watch on Bloodmyst Isle.",title="Step 8: Shooting Stars",icon="Interface\\Icons\\INV_Stone_16"},
[50106] = {coords={{55.9,41.1,539}},description="Take Uuna to the small campsite northwest of Path of the Light in Draenor's Shadowmoon Valley.  She will pick up the flower crown that is resting on one of the chairs around the campfire.",title="Step 9: Flower Crown",icon="Interface\\Icons\\INV_Stone_16"},
[50107] = {icon="Interface\\Icons\\INV_Stone_16",description="Wait for a little while after Uuna picks up the flower crown.  Void tendrils will eventually erupt from the ground and take her captive.",title="Step 10: Uuna Gets Kidnapped"},
[50108] = {icon="Interface\\Icons\\INV_Stone_16",description="Die and ask a Spirit Healer if they have seen Uuna.  The Spirit Healer will give you permission to enter the spirit realm to try to find her.  Resurrect (no need to do it through the Spirit Healer, just return to your corpse) and continue to the next step.",title="Step 11: Spirit Healer"},
[50109] = {coords={{66.1,74.5,115}},description="Click on the Shadow Tear in Dragonblight's Emerald Dragonshrine to look for Uuna in the spirit realm.  Once inside, do the following:\n\n1. |cffffffff/cheer|r at Uuna.\n2. Place a |cffffffffCooking Fire|r next to her.\n3. Survive the gauntlet for 3 minutes, running into the |cff883325Soul-Eaters|r to scare them away.\n4. When Uuna wraps her arms around herself and cries, |cffffffff/hug|r her.",title="Step 12: A Dark Place",icon="Interface\\Icons\\INV_Stone_16"},
